"use strict";

class Product
{
    constructor()
    {
        this.hasCanvas = false;
        this.canvas = null;
        this.ctx = null; 
        this.w = 350;
				this.h = 150;
        this.svg = null;
        this.ns = "http://www.w3.org/2000/svg";
        this._title = $(document).find("title").text().toLowerCase();
		
		this.txt = null;
		this.selOne = null;
		this.selTwo = null;
		this.presetName = "";
	}
	
    test(){console.log("Product.class");}
	
	textPreset(srcTitle)
	{
		switch(srcTitle)
		{
			case "classic name necklace" : return String.fromCharCode(60078).concat("ina=");
			case "mini name necklace" : return String.fromCharCode(60065).concat("melia=");
			case "large name necklace" : return String.fromCharCode(60067).concat("ara=");
			default: return String.fromCharCode(60067).concat("andice=");
		}
	}
	
    loadSvg()
    {
		 try
		 {
			//console.log(this._title);
			this.canvas = $("canvas").get(0);
			this.ctx = this.canvas.getContext("2d");

			var msg = new Item().svg(this._title);
			var parser = new DOMParser();

			this.svg = parser.parseFromString(msg,"image/svg+xml");
			this.svg.getElementsByTagName("text")[0].textContent = this.textPreset(this._title);
			this.drawSvg(this.svg);   
		 }
		 catch(e)
		 {
			 console.log("loadSvg: " + e);
		 }
    }
	
    getInput()
    {
		try
		{
			this.txt = $("input[title='Enter your name here']"); 
		}
		catch(e)
		{
			console.log("getInput: " + e)
		}
    }
	
    getSelAccent()
    {
        try
		{
			var tgt = $('select').toArray();
			//this.selOne =  $(tgt).eq(2);
			$.each(tgt, (index)=> 
			{
				if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Heart")
				{
					this.selOne =  $(tgt)[index];
				}	
			});
		}
		catch(e)
		{
			console.log("getAccent" + e);
		}
    }
	
    getSelAlloy()
    {
		try
		{       
			var tgt = $('select').toArray();
			$.each(tgt, (index)=> 
			{
				if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Silver")
				{
					this.selTwo =  $(tgt)[index];
					//console.log($(tgt)[index].options[2].text);
				}	
			});
		}
		catch(e)
		{
			console.log("getAlloy: " + e);
		}
    }
	
	alloyColor(selTwo)
	{
		try
		{
			var alloy = {0:"#b4b4b4",1:"#b4b4b4", 2:"#CEB878", 3:"#EBC6C3", 4:"#a3a3a3"};//{0:"#b4b4b4",1:"#b4b4b4", 2:"#bbb100", 3:"#e0afbc", 4:"#a3a3a3"};
			var _target = this.svg.getElementsByTagName("text")[0];
			_target.style.fill = alloy[selTwo];
		}
		catch(e)
		{
			console.log("alloyColor: " + e);
		}
	}
    clsCanvas()
    {
		try
		{
				this.canvas = $("#canvas").get(0);
				this.ctx = this.canvas.getContext("2d");
				this.ctx.clearRect(0, 0, this.w, this.h);
		}
		catch(e)
		{
				console.log(e);
		}	
    }
		
	resetCanvas()
    {
        if($(this.txt).val() === "")
        {
            this.clsCanvas();
        }
    }
	
    textFactory(svgDoc, inputName, selectEndOne)
    {
        try 
        {
			if(typeof selectEndOne === 'undefined'){selectEndOne = 0; console.log("selectEndOne undefined: " + selectEndOne);}
			if(typeof inputName === 'undefined'){inputName = "Cara";console.log("my input: " + inputName)}
            //suffix map
            var SUFFIX = {0:61, 1:60091, 2:60040, 3:60123};
            const x = 60000;
            
            var regex = /[\(\)\[\]:;#@\^\|\?\",<>\!\\_=\+\*~`\.\{\}']/g;

            inputName = inputName.split(" ").join("");
            inputName = inputName.replace(regex, "");
            
            //map prefix, body, suffix
            let _a, _b, _c, _d;

            if(inputName.substring(0,1).match(/^[\&|\-]/g))
            {
                return;
            }
			else if(inputName === 'Enteryournamehere')
			{
				return;
			}    
            else
            {
                _a = String.fromCharCode(inputName.substring(0,1).charCodeAt(0) + x);
            }
	     
	     
            _b = "";
            if(inputName.length > 1)
            {
                _b = inputName.substring(1,inputName.length);
            }
            
            _c = String.fromCharCode(SUFFIX[selectEndOne]);
            

            var _target = svgDoc.getElementsByTagName("text")[0];
            _target.textContent = "";
            
            var _prefix ,_body, _suffix;
            _prefix = document.createElementNS(this.ns,"tspan");
            _body = document.createElementNS(this.ns,"tspan");
            _suffix = document.createElementNS(this.ns,"tspan"); 
           
			_prefix.textContent = _a;
			_body.textContent = _b;
			_suffix.textContent = _c;

			_target.appendChild(_prefix);
			_target.appendChild(_body);
			_target.appendChild(_suffix);
        } 
        catch (e) 
        {
            console.log("textFactory: " + e);
        }
    }
    drawSvg(svgDoc)
    {
        try 
        {
            var serializer = new XMLSerializer();
            var svgString = serializer.serializeToString(svgDoc);

            var img = new Image();
            img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

            img.onload = ()=> 
            {
                this.clsCanvas();
								//dropshadow
								this.ctx.shadowOffsetX=3;
								this.ctx.shadowOffsetY=12;
								this.ctx.shadowBlur=2;
								this.ctx.shadowColor="rgba(0,0,0,0.03)";
								//background color
								this.ctx.fillStyle="rgba(228,243,249,0.7)";
								this.ctx.fillOpacity=0.5;
								this.ctx.globalCompositeOperation = 'destination-under'
								this.ctx.fillRect(0, 0, canvas.width, canvas.height);

                this.ctx.drawImage(img, 0, 0, this.w, this.h);
            };
        } 
        catch(e) 
        {
            console.log("drawSvg: " + e);
        }
    }
	
	interactivity()
	{
		try
		{
			this.getInput()
			this.getSelAlloy();
			this.getSelAccent();
		
			this.resetCanvas();
			//update text
			this.textFactory(this.svg, $(this.txt).val(), $(this.selOne).prop("selectedIndex"));
			//update alloy
			this.alloyColor($(this.selTwo).prop("selectedIndex"));
			//paint canvas
			this.drawSvg(this.svg);
		}
		catch(e)
		{
			 console.log("interactivity: " + e);
		}
	}
   render()
   {           
		$(document)
			.on("keyup",$(this.txt),(evt)=>
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			})
			.bind("change",$(this.selOne),(evt)=> 
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			});
    }
    
    init()
    {
		if($("#canvas").length > 0)
		{
				this.loadSvg();
				this.render();
		}
		else
		{
			console.log("No Canvas Found/Contact product.js vendor");
		}
    }
}

